import React from 'react'

import ChartCard from '../Chart/ChartCard'
import { Doughnut } from 'react-chartjs-2'
import ChartLegend from '../Chart/ChartLegend'

export default class Expenses extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      data: [],
      backgroundColor: [],
      labels: []
    }
    this.setState()
  }

  chartData() {
    let expenses = {
      data: {
        datasets: [
          {
            data: [33, 33, 33],
            backgroundColor: ['#0694a2', '#1c64f2', '#7e3af2'],
            label: 'Dataset 1',
          },
        ],
        labels: ['Coinjoin', 'Fees', 'Hardware'],
      },
      options: {
        responsive: true,
        cutoutPercentage: 80,
      },
      legend: {
        display: false,
      },
    }
    return expenses
  }

  render() {
    return (
      <>      
          <ChartCard title="Expenses">
            <Doughnut data={chartData()} />
            <ChartLegend legends={props.categories} />
          </ChartCard>
      </>
    )
  }
}
